--WHERE CONVERT(DATE, CreationDate) = '04.06.2020'
--	AND CreatedBy = 'schmidt'
----WHERE CreatedBy = 'schmidt'
--ORDER BY [DiliveryId] DESC

INSERT INTO dbo.LMS_DELIVERYDETAIL
SELECT d.DiliveryId AS DeliveryId
	,DATEADD(d, v.number, d.FromDate) AS [Date]
	,d.Quantity
	,DATEPART(yyyy, DATEADD(d, v.number, d.FromDate)) AS [year]
	,DATEPART(mm, DATEADD(d, v.number, d.FromDate)) AS [month]
	,DATEPART(iso_week, DATEADD(d, v.number, d.FromDate)) AS cw
	,d.finished
	,d.CreationDate
	,NULL AS ModificationDate
	,NULL AS DeletionDate
	,d.CreatedBy
	,NULL AS ModifiedBy
	,NULL AS DeletedBy
FROM [dbo].[LMS_DELIVERY] d
JOIN master..spt_values v ON v.type = 'P'
	AND v.number BETWEEN 0
		AND datediff(d, d.FromDate, d.UntilDate)
WHERE CONVERT(DATE, CreationDate) = '04.06.2020'
	AND CreatedBy = 'schmidt' AND IsFix = 0
ORDER BY [DiliveryId] DESC

